import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import SwipeableDrawer from '@material-ui/core/SwipeableDrawer';
import Button from '@material-ui/core/Button';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import EmailIcon from '@material-ui/icons/Email';
import WallpaperIcon from '@material-ui/icons/Wallpaper';
import AccountBoxIcon from '@material-ui/icons/AccountBox';
import RadioButtonCheckedIcon from '@material-ui/icons/RadioButtonChecked';

class Page extends React.Component {
    constructor(props) {
        super(props)
    }

    render = () => {
        return <SwipeableDrawer open={true}>
            <PageMenu/>
        </SwipeableDrawer>
    }
}

class PageMenu extends React.Component {
    render = () => {
        return <><p>Отправка</p><Divider / >< List > {
            ['Сообщения', 'Записи'].map((text, index) => (
                <ListItem button key={text}>
                    <ListItemIcon>{index % 2 === 0
                            ? <EmailIcon/>
                            : <WallpaperIcon/>}</ListItemIcon>
                    <ListItemText primary={text}/>
                </ListItem>
            ))
        } < /List>
      <div>Другие настройки</div><Divider / > <List>
            {['Кнопки', 'Дополнительно'].map((text, index) => (
                <ListItem button key={text}>
                    <ListItemIcon>{index % 2 === 0
                            ? <RadioButtonCheckedIcon/>
                            : <AccountBoxIcon/>}</ListItemIcon>
                    <ListItemText primary={text}/>
                </ListItem>
            ))}
        </List> < />
    }
}

export default Page
